CREATE TABLE ta_categorie_preference
(
  id_categorie_preference serial NOT NULL,
  id_parent_categorie_preference did_facultatif,
  code_categorie_preference dlib255,
  libelle_categorie_preference dlib255nn,
  description_categorie_preference dlib255,
  identifiant_module dlib255,
  position integer,
  qui_cree dlib50,
  quand_cree date_heure_lgr,
  qui_modif dlib50,
  quand_modif date_heure_lgr,
  version num_version,
  ip_acces dlib50,
  version_obj did_version_obj,
  CONSTRAINT ta_categorie_preference_pkey PRIMARY KEY (id_categorie_preference),
  CONSTRAINT ta_categorie_preference_code_categorie_preference_key UNIQUE (code_categorie_preference)
);

CREATE TABLE ta_groupe_preference
(
  id_groupe_preference serial NOT NULL,
  code_categorie_preference dlib255,
  libelle_groupe_preference dlib255nn,
  description_groupe_preference dlib255,
  position integer,
  composant_affichage dlib255,
  qui_cree dlib50,
  quand_cree date_heure_lgr,
  qui_modif dlib50,
  quand_modif date_heure_lgr,
  version num_version,
  ip_acces dlib50,
  version_obj did_version_obj,
  CONSTRAINT ta_groupe_preference_pkey PRIMARY KEY (id_groupe_preference)
);

ALTER TABLE ta_preferences ADD COLUMN id_categorie_preference did_facultatif;
ALTER TABLE ta_preferences ADD COLUMN id_groupe_preference did_facultatif;
ALTER TABLE ta_preferences ADD COLUMN fichier_vue dlib255;
ALTER TABLE ta_preferences ADD COLUMN position integer;
ALTER TABLE ta_preferences ADD COLUMN position_dans_groupe integer;
ALTER TABLE ta_preferences ADD COLUMN est_un_groupe boolean default false;
ALTER TABLE ta_preferences ADD COLUMN description text;
ALTER TABLE ta_preferences ADD COLUMN id_utilisateur did_facultatif;

